import React, { useEffect,useState } from "react";
export function NurseSchedule () {
    const [timeSlot, setTimeSlot] = useState([]);

    var myHeader = new Headers();
    myHeader.append("Access-Control-Allow-Origin", "*");

    var requestOption = {
        method: 'GET',
        headers: myHeader,
        mode: 'cors',
        redirect: 'follow'
      };



    useEffect(() => {
        fetch("http://localhost:3000/timeSlot", requestOption)
          .then(response => response.json())
          .then(result => {setTimeSlot(result) ;console.log(result)
        })
          .catch(error => console.log('error', error));
        }, []);

const insertNurseTimeSlotScheduleTable=(timeSlot)=>{

    console.log(timeSlot,JSON.stringify( timeSlot ))
    var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        mode: 'cors',
        redirect: 'follow',
        body: JSON.stringify( timeSlot )  
      };

      fetch("http://localhost:3000/insertNurseTimeSlotScheduleTable", requestOptions)
      .then(response => response.json())
      .then(result => {console.log(result)
    })
      .catch(error => console.log('error', error));

}

    return(<>
    <div class="flex items-center justify-center p-12">

    <div class="relative overflow-x-auto shadow-md sm:rounded-lg">
    <table class="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
            <tr>
                <th scope="col" class="px-6 py-3">
                    Date
                </th>
                <th scope="col" class="px-6 py-3">
                    Time
                </th>
                <th scope="col" class="px-6 py-3">
                    Max Capacity
                </th>

            </tr>
        </thead>
        <tbody>

        {timeSlot.map((time) => 
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    {time["date"]} 
                </th>
                <td class="px-6 py-4">
                    {time["start_time"]}
                </td>
                <td class="px-6 py-4">
                    {time["max_capacity"]}
                </td>


                <td class="px-6 py-4">
                    <button onClick={()=>{insertNurseTimeSlotScheduleTable(time)}} class="font-medium text-blue-600 dark:text-blue-500 hover:underline">Select</button>
                </td>
            </tr>
            )}

        </tbody>
    </table>
</div>
</div>
    </>)}
